// Get all items from the previous node
const items = $input.all();
const timestamp = new Date().toISOString();

// Map each item to the new format
return items.map(item => {
  return {
    json: {
      pageContent: item.json.content, // Maps 'content' to 'pageContent'
      custom_metadata: {
        topic: item.json.topic,
        response_sent: item.json.response_sent,
        created_at: timestamp
      }
    }
  };
});
